Walrus blobs are represented as Sui objects of type Blob. A blob is first registered, indicating that the storage nodes should expect slivers from a Blob ID to be stored. Then a blob is certified indicating that a sufficient number of slivers have been stored to guarantee the blob's availability. When a blob is certified its certified field contains the epoch in which it was certified. A Storage object is always associated with a Blob object, reserving enough space for a long enough period for the blob's storage. A certified blob is available for the period the underlying storage resource guarantees storage. Concretely, Blob and Storage objects have the following fields, that can be read through the Sui SDKs: /// The blob structure represents a blob that has been registered to with some
/// storage, and then may eventually be certified as being available in the
/// system.
public struct Blob has key, store { id: UID, stored_epoch: u64, blob_id: u256, size: u64, erasure_code_type: u8, certified: option::Option<u64>, // The epoch first certified, // or None if not certified. storage: Storage,
} /// Reservation for storage for a given period, which is inclusive start,
/// exclusive end.
public struct Storage has key, store { id: UID, start_epoch: u64, end_epoch: u64, storage_size: u64,
} All fields of Blob and Storage objects can be read using the expected functions: // Blob functions
public fun stored_epoch(b: &Blob) : u64;
public fun blob_id(b: &Blob) : u256;
public fun size(b: &Blob) : u64;
public fun erasure_code_type(b: &Blob) : u8;
public fun certified(b: &Blob) : &Option<u64>;
public fun storage(b: &Blob) : &Storage; // Storage functions
public fun start_epoch(self: &Storage) : u64;
public fun end_epoch(self: &Storage) : u64;
public fun storage_size(self: &Storage) : u64;

