When a blob is first registered a BlobRegistered event is emitted that informs storage nodes that they should expect slivers associated with its Blob ID. Eventually when the blob is certified a BlobCertified is emitted containing information about the blob ID and the epoch after which the blob will be deleted. Before that epoch the blob is guaranteed to be available. /// Signals a blob with metadata is registered.
public struct BlobRegistered has copy, drop { epoch: u64, blob_id: u256, size: u64, erasure_code_type: u8, end_epoch: u64,
} /// Signals a blob is certified.
public struct BlobCertified has copy, drop { epoch: u64, blob_id: u256, end_epoch: u64,
} The InvalidBlobID event is emitted when storage nodes detect an incorrectly encoded blob. Such a blob is guaranteed to be also detected as invalid when a read is attempted. /// Signals that a BlobID is invalid.
public struct InvalidBlobID has copy, drop { epoch: u64, // The epoch in which the blob ID is first registered as invalid blob_id: u256,
}

