The Walrus system object contains metadata about the available and used storage, as well as the price of storage per Kib of storage in MIST. The committee structure within the system object can be used to read the current epoch number, as well as information about the committee. const BYTES_PER_UNIT_SIZE : u64 = 1_024; public struct System<phantom WAL> has key, store { id: UID, /// The current committee, with the current epoch. /// The option is always Some, but need it for swap. current_committee: Option<Committee>, /// When we first enter the current epoch we SYNC, /// and then we are DONE after a cert from a quorum. epoch_status: u8, // Some accounting total_capacity_size : u64, used_capacity_size : u64, /// The price per unit size of storage. price_per_unit_size: u64, /// Tables about the future and the past. past_committees: Table<u64, Committee>, future_accounting: FutureAccountingRingBuffer<WAL>,
} public struct Committee has store { epoch: u64, bls_committee : BlsCommittee,
} A few public functions of the committee allow contracts to read Walrus metadata: /// Get epoch. Uses the committee to get the epoch.
public fun epoch<WAL>(self: &System<WAL>) : u64; /// Accessor for total capacity size.
public fun total_capacity_size<WAL>(self: &System<WAL>) : u64; /// Accessor for used capacity size.
public fun used_capacity_size<WAL>(self: &System<WAL>) : u64; // The number of shards
public fun n_shards<WAL>(self: &System<WAL>) : u16;
